DELIMITER $$
--
-- Procedimientos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetMarketingDashboardData` (IN `startDate` DATE, IN `endDate` DATE, IN `citys` TEXT, IN `invalid` INT)   BEGIN
    -- Eliminar la tabla temporal si ya existe
    DROP TEMPORARY TABLE IF EXISTS temp_citys;

    -- Crear una tabla temporal para almacenar los valores de citys
    CREATE TEMPORARY TABLE temp_citys (city_id INT);

    -- Dividir la cadena de citys y almacenar los valores en la tabla temporal
    SET @sql = CONCAT('INSERT INTO temp_citys (city_id) VALUES (', REPLACE(citys, ',', '), ('), ');');
    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;

    -- Variable para la condición de la cláusula WHERE
    SET @location_condition = IF(citys = '0', 'NOT IN', 'IN');
    SET @invalid_condition = IF(invalid = 1, 'AND jc.status_name NOT IN (''Invalid'', ''Unresponsive'', ''Lost Sales'')', '');

    -- SECTION YTD RESULTS BY MARKETING CHANNEL
    SET @sql = CONCAT(
        'SELECT 
            mc.source_name,
            COUNT(DISTINCT jc.id) AS leads,
            SUM(CASE WHEN mcs.status_name = ''Appointment Valid'' THEN 1 ELSE 0 END) AS appointments,
            ROUND((SUM(CASE WHEN mcs.status_name = ''Appointment Valid'' THEN 1 ELSE 0 END) / COUNT(DISTINCT jc.id)) * 100, 2) AS `porc_appointments`,
            SUM(CASE WHEN mcs.status_name = ''Demo Valid'' THEN 1 ELSE 0 END) AS demos,
            IFNULL(ROUND((SUM(CASE WHEN mcs.status_name = ''Demo Valid'' THEN 1 ELSE 0 END) / NULLIF(SUM(CASE WHEN mcs.status_name = ''Appointment Valid'' THEN 1 ELSE 0 END), 0)) * 100, 2), 0.00) AS `porc_demos`,
            IFNULL(sales_data.sales, 0) AS sales,
            IFNULL(ROUND((IFNULL(sales_data.sales, 0) /  NULLIF(SUM(CASE WHEN mcs.status_name = ''Appointment Valid'' THEN 1 ELSE 0 END), 0)) * 100, 2), 0.00) AS `porc_sales`,
            IFNULL(ROUND((IFNULL(sales_data.sales, 0) / NULLIF(SUM(CASE WHEN mcs.status_name = ''Demo Valid'' THEN 1 ELSE 0 END), 0)) * 100, 2), 0.00) AS `demo_effectivity`,
            FORMAT(IFNULL(revenue_data.total_revenue, 0), 2) AS revenue, 
            FORMAT(IFNULL(mcs_spend.total_amount, 0), 2) AS cost,
            FORMAT(IFNULL(mcs_spend.total_amount, 0) / COUNT(DISTINCT jc.id), 2) AS `cost_leads`,
            CASE 
                WHEN IFNULL(sales_data.sales, 0) > 0 AND IFNULL(mcs_spend.total_amount, 0) > 0 THEN FORMAT(IFNULL(mcs_spend.total_amount, 0) / sales_data.sales, 2)
                ELSE 0.00
            END AS `cost_sales`,
            CASE 
                WHEN IFNULL(revenue_data.total_revenue, 0) > 0 AND IFNULL(mcs_spend.total_amount, 0) > 0 THEN ROUND(((IFNULL(revenue_data.total_revenue, 0) - IFNULL(mcs_spend.total_amount, 0)) / IFNULL(mcs_spend.total_amount, 1)) * 100, 2)
                ELSE 0.00
            END AS `porc_roi`,
            IFNULL(ROUND((COUNT(DISTINCT jc.id) / NULLIF(total_leads.total_leads, 0)) * 100, 2), 0.00) AS `leads_effectivity`,
            IFNULL(ROUND((SUM(CASE WHEN mcs.status_name = ''Appointment Valid'' THEN 1 ELSE 0 END) / NULLIF(appointments_data.total_appointments, 0)) * 100, 2), 0.00) AS `lead_source_effectivity_set_appointments`,
            IFNULL(ROUND((SUM(CASE WHEN mcs.status_name = ''Demo Valid'' THEN 1 ELSE 0 END) / NULLIF(demos_data.total_demos, 0)) * 100, 2), 0.00) AS `lead_source_effectivity_demo`,
            IFNULL(ROUND((IFNULL(sales_data.sales, 0) / NULLIF(signed_contracts_data.total_signed_contracts, 0)) * 100, 2), 0.00) AS `lead_source_effectivity_sales`,
            SUM(CASE WHEN mcs.status_name = ''Invalid'' THEN 1 ELSE 0 END) AS `invalid`,
            SUM(CASE WHEN mcs.status_name = ''Unresponsive'' THEN 1 ELSE 0 END) AS `unresponsive`,
            SUM(CASE WHEN mcs.status_name = ''Lost Sales'' THEN 1 ELSE 0 END) AS `lost_sales`
        FROM 
            jobnimbus_contacts jc
            INNER JOIN marketing_channels mc ON jc.source_name = mc.source_name
            LEFT JOIN (
                SELECT 
                    id_marketing_channels, 
                    SUM(amount) AS total_amount
                FROM 
                    marketing_channel_spend
                WHERE
                    date_create BETWEEN ''', startDate, ''' AND ''', endDate, '''
                    AND is_active = 1
                GROUP BY 
                    id_marketing_channels
            ) mcs_spend ON mc.id = mcs_spend.id_marketing_channels
            LEFT JOIN (
                SELECT 
                    id_jobnimbus_contacts,
                    jcs.status_name,
                    MAX(date_create) AS last_status_date
                FROM 
                    jobnimbus_contacts_status_historicals jcs
                WHERE 
                    is_active = 1
                GROUP BY 
                    id_jobnimbus_contacts, jcs.status_name
            ) mcs ON jc.id = mcs.id_jobnimbus_contacts
            LEFT JOIN (
                SELECT 
                    jc.source_name,
                    SUM(CASE WHEN jcs.status_name = ''Signed Contract'' THEN 1 ELSE 0 END) AS sales
                FROM 
                    jobnimbus_contacts jc
                    INNER JOIN jobnimbus_contacts_status_historicals jcs ON jc.id = jcs.id_jobnimbus_contacts
                WHERE 
                    jcs.status_name = ''Signed Contract''
                    AND jc.date_create BETWEEN ''', startDate, ''' AND ''', endDate, '''
                     AND JSON_EXTRACT(jc.location, ''$.id'') ', @location_condition, ' (SELECT city_id FROM temp_citys)
                GROUP BY 
                    jc.source_name
            ) sales_data ON jc.source_name = sales_data.source_name
            LEFT JOIN (
                SELECT jc.source_name, SUM(jc.cf_double_5) AS total_revenue
                FROM jobnimbus_contacts jc
                WHERE jc.cf_double_5 > 0
                    AND jc.date_create BETWEEN ''', startDate, ''' AND ''', endDate, '''
                    AND JSON_EXTRACT(jc.location, ''$.id'') ', @location_condition, ' (SELECT city_id FROM temp_citys)
                GROUP BY jc.source_name
            ) revenue_data ON jc.source_name = revenue_data.source_name
            LEFT JOIN (
                SELECT 
                    SUM(CASE WHEN jcs.status_name = ''Appointment Valid'' THEN 1 ELSE 0 END) AS total_appointments
                FROM 
                    jobnimbus_contacts_status_historicals jcs
                    JOIN jobnimbus_contacts jc ON jcs.id_jobnimbus_contacts = jc.id
                WHERE 
                    jc.date_create BETWEEN ''', startDate, ''' AND ''', endDate, '''
                     AND JSON_EXTRACT(jc.location, ''$.id'') ', @location_condition, ' (SELECT city_id FROM temp_citys)
            ) appointments_data ON 1=1
            LEFT JOIN (
                SELECT 
                    SUM(CASE WHEN jcs.status_name = ''Demo Valid'' THEN 1 ELSE 0 END) AS total_demos
                FROM 
                    jobnimbus_contacts_status_historicals jcs
                    JOIN jobnimbus_contacts jc ON jcs.id_jobnimbus_contacts = jc.id
                WHERE 
                    jc.date_create BETWEEN ''', startDate, ''' AND ''', endDate, '''
                     AND JSON_EXTRACT(jc.location, ''$.id'') ', @location_condition, ' (SELECT city_id FROM temp_citys)
            ) demos_data ON 1=1
            LEFT JOIN (
                SELECT 
                    SUM(CASE WHEN jcs.status_name = ''Signed Contract'' THEN 1 ELSE 0 END) AS total_signed_contracts
                FROM 
                    jobnimbus_contacts_status_historicals jcs
                    JOIN jobnimbus_contacts jc ON jcs.id_jobnimbus_contacts = jc.id
                WHERE 
                    jc.date_create BETWEEN ''', startDate, ''' AND ''', endDate, '''
                     AND JSON_EXTRACT(jc.location, ''$.id'') ', @location_condition, ' (SELECT city_id FROM temp_citys)
            ) signed_contracts_data ON 1=1
            CROSS JOIN (
                SELECT COUNT(*) AS total_leads 
                FROM jobnimbus_contacts jc
                INNER JOIN marketing_channels mc ON jc.source_name = mc.source_name
                WHERE jc.source_name IS NOT NULL AND mc.is_active = 1  AND jc.date_create BETWEEN ''', startDate, ''' AND ''', endDate, '''
                AND JSON_EXTRACT(jc.location, ''$.id'') ', @location_condition, ' (SELECT city_id FROM temp_citys)
                ', @invalid_condition, ' 
            ) total_leads
        WHERE 
            jc.source_name IS NOT NULL
            AND mc.is_active=1
            AND jc.date_create BETWEEN ''', startDate, ''' AND ''', endDate, '''
            AND JSON_EXTRACT(jc.location, ''$.id'') ', @location_condition, ' (SELECT city_id FROM temp_citys)
            ', @invalid_condition, ' 
        GROUP BY 
            mc.source_name
        ORDER BY 
            leads DESC'
    );

    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;

    -- SECTION TOTAL LEADS BY MONTH
    SET @sql = CONCAT(
        'SELECT 
            DATE_FORMAT(j.date_create, ''%M %Y'') AS month,
            c.city_name,
            COUNT(*) AS count,
            FORMAT(IFNULL(SUM(j.cf_double_5), 0), 2) AS mount,
            0 AS percentage,
            true AS visible,
            c.colors_charts
        FROM 
            jobnimbus_contacts j
        JOIN 
            citys c ON JSON_EXTRACT(j.location, ''$.id'') = c.id_location_jobnimbus
        JOIN 
            months m ON MONTH(j.date_create) = m.id_month
        JOIN 
            marketing_channels mc ON j.source_name = mc.source_name
        WHERE
            j.date_create >= DATE_SUB(CURDATE(), INTERVAL 13 MONTH)
            AND j.is_active = 1
            AND c.is_active = 1
            AND mc.is_active=1
        GROUP BY 
            month, c.city_name
        ORDER BY 
            YEAR(j.date_create), m.id_month, MONTH(j.date_create), c.city_name'
    );

    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;

    -- SECTION TOTAL REVENUES BY MONTH
    SET @sql = CONCAT(
        'SELECT 
            DATE_FORMAT(j.date_create, ''%M %Y'') AS month,
            c.city_name,
            COUNT(*) AS count,
            FORMAT(IFNULL(SUM(j.cf_double_5), 0), 2) AS mount,
            0 AS percentage,
            true AS visible,
            c.colors_charts
        FROM 
            jobnimbus_contacts j
        JOIN 
            citys c ON JSON_EXTRACT(j.location, ''$.id'') = c.id_location_jobnimbus
        JOIN 
            months m ON MONTH(j.date_create) = m.id_month
        JOIN 
            marketing_channels mc ON j.source_name = mc.source_name
        WHERE
            j.cf_double_5 > 0 AND j.cf_double_5 IS NOT NULL
            AND j.date_create >= DATE_SUB(CURDATE(), INTERVAL 13 MONTH)
            AND j.is_active = 1
            AND c.is_active = 1
            AND mc.is_active=1
        GROUP BY 
            month, c.city_name
        ORDER BY 
            YEAR(j.date_create), m.id_month, MONTH(j.date_create), c.city_name'
    );

    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;

    -- SECTION FILTERS CITY
    SELECT 
        c.id_location_jobnimbus AS id, 
        c.city_name AS name 
    FROM 
        citys c 
    WHERE 
        c.is_active IN(1) 
    ORDER BY 
        c.city_name ASC;

    -- Eliminar la tabla temporal
    DROP TEMPORARY TABLE temp_citys;
END$$

DELIMITER ;

